import background from './images/background.jpg';
function App() {
  const backgroundImageStyle = {
    backgroundImage: `url(${myImage})`,
    height: '500px',
    backgroundSize: 'cover',
    backgroundPosition: 'center'
  };

  return (
    <div style={backgroundImageStyle}>
      <h1>My Background Image</h1>
    </div>
  );
}

export default App;
